import { FA_USERS, FA_DASHBOARD } from "./fa-icons";

export const SIDE_MENU = [
  { id: "1", name: "Dashboard", icon: { FA_USERS } },
  { id: "2", name: "Student", icon: { FA_DASHBOARD } },
];
